import React from "react";
import classes from "./Input.module.css";
export default function Input(props) {
  return (
    <React.Fragment>
      <div className={classes.input}>
        <label>Amnount</label>
        <input
          type={props.type}
          value={props.value}
          id={props.id}
        ></input>
      </div>
    </React.Fragment>
  );
}
